// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadCouriData(char *Buffer)
{
    memcpy(Buffer, &CouriL0[1], CouriL0[0] << 2);
    Buffer += (CouriL0[0] << 2);

    memcpy(Buffer, &CouriL1[1], CouriL1[0] << 2);
    Buffer += (CouriL1[0] << 2);

    memcpy(Buffer, &CouriB[1], CouriB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char CouriName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillCouriData(void)
{
    remove(CouriName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteCouriData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(CouriName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, CouriName)) return "";
    #endif

    if (!(han = fopen(CouriName, "wb"))) return "";
    if (AutoClean) atexit(KillCouriData);

    num = fwrite(&CouriL0[1], 4, CouriL0[0], han);
    if (num != CouriL0[0]) {fclose(han); return "";}

    num = fwrite(&CouriL1[1], 4, CouriL1[0], han);
    if (num != CouriL1[0]) {fclose(han); return "";}

    num = fwrite(&CouriB[1], 1, CouriB[0], han);
    if (num != CouriB[0]) {fclose(han); return "";}

    fclose(han);
    return CouriName;
}

